                                    <label for="OwnerNo">Contact Number:</label>
                                    <input class="form-control form-control-user" id="exampleContactNo"
                                        placeholder="Contact Number"  type="number" name="OwnerNo" value={ownerNo} onChange = {handleOwnerNo} />
                                </div>
                                
